import React from 'react';
import firebase from 'firebase';
const logOutUser = () => {
 firebase.auth().signOut();
};

class LogOut extends Component {
    render() {
        return(
            <a onClick={logOutUser}>Log Out</a>
        );
    }
}

export default LogOut;
